import './App.css';
import Nav from './components/Nav';
import Home from './components/Home';
import Tweet from './components/Tweet';
import {BrowserRouter as Router, Switch as Sw, Route as Rou} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
          <Nav />
          <Sw>
            <Rou path="/" exact component={Home} />
            <Rou path="/tweets" exact component={Tweet} />
          </Sw>
      </div>
    </Router>
  );
}

export default App;
